import React from 'react'


const Table = ({lista}) => (
  <div>
    {lista.map((row, i)=>(
      <ul>
        {console.log(row)}
        <li key={i}>{row.name}</li>
        <li key={i+1}>{row.data}</li>
      </ul>
    ))}
  </div>
)

export default Table
